    if not s:
        return ""

    expanded_string = []
    i = 0
    n = len(s)
    while i < n:
        if s[i].isdigit():
            repeat_count = int(s[i])
            i += 1
            while i < n and s[i].isalpha():
                expanded_string.append(s[i] * repeat_count)
                i += 1
        else:
            expanded_string.append(s[i])
            i += 1

    return ''.join(expanded_string)
```

